import React, { useEffect, useState } from 'react';
import { Box, Typography, Stack, Button, Grid, Paper } from '@mui/material';
import axios from 'axios';
import MyButton from '../MyButton';

const getNonAdminTable = ({ handleUser }) => {
    const contentPerPage = 5;
    const [users, setUsers] = useState([]);
    const [prikazaniUseri, setPrikazaniUseri] = useState(contentPerPage);
    const [data, setDataList] = useState([]);
    const [refresh, setRefresh] = useState(false);
    const navigateTo = useNavigate();


    React.useEffect(() => {
        const getData = async () => {
            let dataa = (
                await axios.get('http://localhost:5000/session')
            ).data;
            //setValue(data[0]);
            setDataList(dataa);
        };
        getData().catch((err) => console.log(err));
        handleGetUsers();
    }, [refresh]);

    const handleLoadMore = () => {
        setPrikazaniUseri(prikazaniUseri + contentPerPage);
    };
    const handleGetUsers = async () => {
        try {
            const response = await axios.get(`http://localhost/getNonAdmins`);
            setUsers(response.data);
        } catch (err) {
            console.error(err);
            showError('Greška kod dohvaćanja rezervacije!');
        }
    };


    return (
        <Stack direction='column' spacing='2rem'>
            {users.length > 0 ?
                <Stack direction='column' spacing='1rem'>
                    {users.map((user, index) => {
                        if (index >= prikazaniUseri) return;
                        return (
                            <Box key={index}>
                                <Grid container alignItems='center' spacing='1rem' onClick={() => handleUser(user)} sx={{ cursor: 'pointer' }}>
                                    <Grid item xs={12} md={11} direction="row">
                                        <p>{user.username}</p>
                                        <p>{user.name}</p>
                                        <p>{user.surname}</p>
                                        <MyButton>Ukloni</MyButton>
                                    </Grid>
                                </Grid>
                            </Box>
                        );
                    })}
                    {prikazaniUseri >= users.length ?
                        undefined
                        : <Stack direction='row' justifyContent='center'>
                            <Button variant='contained' onClick={handleLoadMore}>Load more</Button>
                        </Stack>
                    }
                </Stack>
                : <Stack direction='row' justifyContent='center'>
                    <Typography variant='h6'>Nema rezultata</Typography>
                </Stack>
            }
        </Stack>
    );
};

export default getNonAdminTable;
